    return (
        <View style={{ flex: 2}}>
          <View style={{flex:3,flexDirection:'row', height:'30px', backgroundColor:'blue', justifyContent:'space-evenly'}}>
          <CustomSearchBar/>
          <FontAwesomeIcon icon={ faShoppingCart } size={25} style={styles.icon}  />
         </View>
         <Text>Hola</Text>
         {/* <SlideImages/> */}

      </View>
    )
}

export default Home

const styles = StyleSheet.create({
  icon:{
    color:'#E49012',
